from numpy import inf
from collections import deque

class Solution:

    def maxDistance(self, grid):

        def bfs(r, c, max_distance = -1):
            visited = set([(r, c)])
            queue = deque([(r, c)])
            while queue:
                cur_r, cur_c = queue.popleft()
                neighbors = getNeighbors(cur_r, cur_c)
                min_value = inf
                if grid[cur_r][cur_c] == 1:
                    for n_r, n_c in neighbors:
                        if grid[n_r][n_c] == 0:
                            min_value = 0
                        if grid[n_r][n_c] == 1:
                            if (n_r, n_c) in visited:
                                min_value = min(min_value, output[n_r][n_c])
                        if (n_r, n_c) not in visited:
                            queue.append((n_r, n_c))
                            visited.add((n_r, n_c))
                    output[cur_r][cur_c] = min_value + 1
                else:
                    output[cur_r][cur_c] = 0
                    for n_r, n_c in neighbors:
                        if (n_r, n_c) not in visited:
                            queue.append((n_r, n_c))
                            visited.add((n_r, n_c))
            return output

        def getNeighbors(r, c):
            directions = [(0, 1), (1, 0), (-1, 0), (0, -1)]
            neighbors = []
            for d in directions:
                neighbor_r, neighbor_c = r + d[0], c + d[1]
                if 0 <= neighbor_r < len(grid) and 0 <= neighbor_c < len(grid[0]):
                    neighbors.append((neighbor_r, neighbor_c))
            return neighbors

        def refreshGrid(output):
            max_distance = -1
            for r in range(len(output)):
                for c in range(len(output[0])):
                    if output[r][c] == 0:
                        continue
                    min_val = inf
                    for n_r, n_c in getNeighbors(r,c):
                        min_val = min(output[n_r][n_c], min_val)
                    output[r][c] = min_val + 1
                    max_distance = max(max_distance, output[r][c])
            # print('refresh', output)
            return max_distance

        output = [[inf] * len(arr) for arr in grid]

        for i in range(len(grid)):
            for j in range(len(grid[0])):
                if (grid[i][j] == 0):
                    grid[i][j] = 1
                else:
                    grid[i][j] = 0
        # print('new grid', grid)
        for i in range(len(grid)):
            for j in range(len(grid[0])):
                if grid[i][j] == 1 and any(grid[neighbor_r][neighbor_c] == 0 for (neighbor_r, neighbor_c) in getNeighbors(i, j)):
                    new_output = bfs(i, j)
                    return refreshGrid(new_output)
        return -1

